(function () {
  "use strict";

  // --- Config ---
  const TEXT_TARGET = "The Costco Anywhere Visa® Card by Citi";
  const TEXT_REPLACEMENT = "The Costco Anywhere AMEX® Card by Datastealth";

  const IMAGE_URL = "https://mobilecontent.costco.com/live/resource/img/static-us-landing-pages/Costco_Consumer_Visa_k90_1536x969.png";
  const BASE64_SRC = "data:image/png;base64,";

  const IMAGE_REPLACEMENT_HTML = `
    <img src="${BASE64_SRC}" alt="" 
         style="width: 96px; float: left; margin-right: 15px;" 
         data-airgap-id="30">
  `;

  // --- Core replace function ---
  function replaceContent(node) {
    if (!node) return;

    // Replace text nodes
    if (node.nodeType === Node.TEXT_NODE) {
      if (node.nodeValue.includes(TEXT_TARGET)) {
        node.nodeValue = node.nodeValue.replaceAll(TEXT_TARGET, TEXT_REPLACEMENT);
      }
      if (node.nodeValue.includes(IMAGE_URL)) {
        const wrapper = document.createElement("span");
        wrapper.innerHTML = node.nodeValue.replaceAll(IMAGE_URL, IMAGE_REPLACEMENT_HTML);
        node.replaceWith(...wrapper.childNodes);
      }
      return;
    }

    // Replace image elements
    if (node.nodeType === Node.ELEMENT_NODE) {
      if (node.tagName === "IMG" && node.src === IMAGE_URL) {
        const newEl = document.createElement("div");
        newEl.innerHTML = IMAGE_REPLACEMENT_HTML;
        node.replaceWith(newEl.firstChild);
        return;
      }

      // Skip script/style/textarea/noscript to avoid breaking things
      if (/^(SCRIPT|STYLE|TEXTAREA|NOSCRIPT)$/i.test(node.tagName)) return;

      // Recurse through children
      for (const child of node.childNodes) replaceContent(child);
    }
  }

  // --- Initialization function ---
  function init() {
    replaceContent(document.body);

    // Watch for new dynamic content
    const observer = new MutationObserver((mutations) => {
      for (const mutation of mutations) {
        if (mutation.type === "characterData") {
          replaceContent(mutation.target);
        } else {
          for (const added of mutation.addedNodes) {
            replaceContent(added);
          }
        }
      }
    });

    observer.observe(document.body, {
      childList: true,
      subtree: true,
      characterData: true,
    });

    console.log("✅ Costco text + image replacement active across the whole page");
  }

  // --- Run immediately if ready, or wait for DOM load ---
  if (document.readyState === "complete" || document.readyState === "interactive") {
    init();
  } else {
    document.addEventListener("DOMContentLoaded", init);
  }

})();

